class AnalysisImp:
    def __init__(self, html):
        soup = BeautifulSoup(html, 'lxml')
        print(self.order_list(soup, id_='taxCreditList'))

    @staticmethod
    def order_list(soup, id_=None):
        """
        主要用处处理有序(标题与内容一一对应)的列表。
        :param soup: 经Beautiful soup处理过的企查查html分页
        :param id_: id_为html中包含数据的列表id
        :return: 返回列表包含的字典数据 [{'序号':'1'},{'序号':'2'}]
        """
        if id_:
            try:
                _list = soup.find('section', id=id_).find('table').find_all('tr', recursive=False)
            except AttributeError:
                print(id_ + '不存在')
                return None
            content_all = []
            data = []
            try:
                _title = [_.text.strip() for _ in soup.find('section', id=id_).find_all('th')]
                # _title：标题列表
            except:
                raise TitleError('{}标题为空'.format(id_))
            for i in _list:
                if 'td ' in str(i):
                    _content_all = []
                    for _ in i.find_all('td', recursive=False):
                        if 'img' in str(_):
                            _content_all.append(_.find('img').attrs['src'])
                        else:
                            _content_all.append(_.text.strip().replace(' ', ''))
                    content_all.append(_content_all)
                    # _content_all：内容列表
            if _title:
                for content_list in content_all:
                    _dict = {}
                    for num, content in enumerate(content_list):
                        _dict.update({_title[num]: content})
                    data.append(_dict)
                return data
            else:
                raise TitleError('{}error'.format(id_))
        else:
            raise ArgumentsError('未传入正确参数')


